- input: "TEXT\x1CC00145037\x1C.TEXT\x1C\x1CF3XA\x1CPlease note the donor, Jim Rubright,
    gave an additional $5,000 on 12/11/09 with the intent to designate that contribution
    for the 2010 year. The PAC inadvertently received & deposited his contribution
    before the end of the calendar year. The money was refunded on 1/26/10, and the
    refund check will be accounted for on the Jan. 2010 FEC report (due 2/20/10).
    \                                                                                                                                                                                                                 Ms.
    Foster married and changed her name.  The PAC inadvertenly missed her last $5
    payroll deduction due to her name change.  This has been corrected.\n"
